import React from 'react'
import Transaction from './Transaction';

const TransactionList = () => {
    const transactions = [
		{ id: 12, date: '10-02-2023', vendor: 'Target', amount: 40, category:'shopping' },
		{ id: 13, date: '10-01-2023', vendor: 'Exxon', amount: 20, category:'gas' },
        { id: 14, date: '10-01-2023', vendor: 'Rent', amount: 900, category:'rent' },

	];

    return (
		<ul className='list-group'>
			{transactions.map((t) => (
				<Transaction id={t.id} date={t.date} vendor={t.vendor} amount={t.amount} category={t.category} />
			))}
		</ul>
    )
}

export default TransactionList
